-- psql -d needymap -f needymap.sql
DROP TABLE IF EXISTS donation;
DROP TABLE IF EXISTS needs;
DROP TABLE IF EXISTS privatemessage;
DROP TABLE IF EXISTS chat;
DROP TABLE IF EXISTS contact;
DROP TABLE IF EXISTS secretcodes;
DROP TABLE IF EXISTS users;

CREATE TABLE users (
    id SERIAL PRIMARY KEY,
    firstname VARCHAR(100) NOT NULL,
    lastname VARCHAR(100) NOT NULL,
    email VARCHAR(100) NOT NULL UNIQUE,
    password VARCHAR(100) NOT NULL,
    bio TEXT,
    image TEXT
);

CREATE TABLE secretcodes (
    id SERIAL PRIMARY KEY,
    users_email VARCHAR(100) NOT NULL REFERENCES users(email),
    code VARCHAR NOT NULL,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);

CREATE TABLE contact (
    id SERIAL PRIMARY KEY,
    firstname VARCHAR(100) NOT NULL,
    lastname VARCHAR(100) NOT NULL,
    email VARCHAR(100) NOT NULL UNIQUE,
    phone VARCHAR(100) NOT NULL,
    message TEXT
);

 CREATE TABLE chat(
     id SERIAL PRIMARY KEY,
     message TEXT,
     user_id INT REFERENCES users(id) NOT NULL,
     created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
 );

 CREATE TABLE privatemessage (
    id SERIAL PRIMARY KEY,
    sender_id INT NOT NULL REFERENCES users(id),
    recipient_id INT NOT NULL REFERENCES users(id),
    message TEXT,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
 );

 CREATE TABLE needs (
    id SERIAL PRIMARY KEY,
    needer_id INT NOT NULL REFERENCES users(id),
    latitude FLOAT,
    longitude FLOAT,
    category VARCHAR(100) NOT NULL,
    description TEXT,
);

CREATE TABLE donation (
    id SERIAL PRIMARY KEY,
    donater_id INT NOT NULL REFERENCES users(id),
    latitude FLOAT,
    longitude FLOAT,
    category VARCHAR(100) NOT NULL,
    description TEXT,
    image TEXT,
);

